import React from "react";
import "../styles/Skills.css";

const skills = [
  { category: "Programming Languages", list: ["JavaScript", "Python", "C"] },
  { category: "Web Development", list: ["React.js", "HTML", "CSS", "JavaScript"] },
  { category: "UI/UX Design", list: ["Figma", "Adobe XD", "Prototyping"] },
  { category: "Tools & Platforms", list: ["Git", "VS Code", "Firebase"] },
];

const Skills = () => {
  return (
    <div className="skills-container">
      <h1 className="skills-heading">Skills</h1>
      <div className="skills-grid">
        {skills.map((skill, index) => (
          <div key={index} className="skill-category">
            <h2>{skill.category}</h2>
            <ul>
              {skill.list.map((item, i) => (
                <li key={i}>{item}</li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Skills;
